import "./App.css";
import logo from "./images/logo.jpeg";
function App() {
  return (
    <div>
      <Header/>
    </div>
  );
}

export default App;

function Header() {
  return (
    <div className="flex flex-row h-16">
      <img src={logo} alt="logo" className=""></img>
    </div>
  );
}
